import React from 'react';

const Single = ({key, que}) => {
	const data = JSON.parse(sessionStorage.getItem(que));
	const options = data.options;

	return (
		<div key={`${que}_${key}`}>
			<div>{que}</div>
			{options.map(option => (
				// <li key={key} id={que}>
				// 	<span>{option.id}.</span>
				// 	<span>{option.content}</span>
				// </li>
				<div key={key} id={option.id}>
					{option.id}.{'\t'}{option.content}
				</div>
			))}
		</div>
	);
};

export default Single;
